import React from 'react';

const Card = () => {
	return
	(
		<div>
			<h1>{ name }</h1>
			<h2>{ gender }</h2>
			<h2>{ height }</h2>
			<h2>{ mass }</h2>
			<h2>{ species }</h2>
			<h2>{ homeworld }</h2>

		</div>

	)

}





export default Card;
